import React, { useEffect, useState } from "react";
import { connect, useSelector } from "react-redux";
import { useParams } from "react-router-dom";
import stlDetail from "./Detail.module.css";
import NavBar from "../../components/NavBar/NavBar";
import Footer from "../../components/Footer/Footer";
import { getCountries } from "../../redux/actions/index";

const Detail = (props) => {
  const { id } = useParams();
  const allCountries = useSelector((state) => state.countries);
  const [activities, setActivities] = useState([]);
  const [selectedActivity, setSelectedActivity] = useState(null);

  useEffect(() => {
    // Realizar llamada a la API para obtener actividades del paÃ­s
    fetch(`http://localhost:3001/activities/countries-activities/${id}`)
      .then((response) => response.json())
      .then((data) => {
        setActivities(data.relatedActivities);
      })
      .catch((error) => {
        console.error("Error fetching activities:", error);
      });
  }, [id]);


  const countryFound = allCountries.find((country) => country.id === id);

  if (!countryFound) {
    return <div>PaÃ­s no encontrado</div>;
  }

  const handleSelectActivity = (event) => {
    const selectedActivityId = event.target.value;
    const activity = activities.find((activity) => activity.id === selectedActivityId);
    setSelectedActivity(activity);
  };

  
console.log(selectedActivity);
  

  const { name, continent, capital, subregion, area, population, flag } =
    countryFound;

  return (
    <div>
      <NavBar />

      <div className={stlDetail.detailCont}>
        <div className={stlDetail.nameidCont}>
          <h1>Country: {name}</h1>
        </div>

        <div className={stlDetail.coutryDetail}>
          <div className={stlDetail.infoCont}>
            <div>
              <h2>Id: {id}</h2>
              <h2>Area: {area.toLocaleString()} KmÂ²</h2>
              <h2>Capital: {capital}</h2>
              <h2>Continent: {continent}</h2>
              <h2>Subregion: {subregion}</h2>
              <h2>Population: {population.toLocaleString()}</h2>
            </div>
          </div>

          <div className={stlDetail.flagCont}>
            <img src={flag} alt="" />
          </div>

          <div className={stlDetail.resCont}>
            <div>
              <h2>Activities:</h2>
              <select onChange={handleSelectActivity}>
                <option value="">Seleccione una actividad</option>
                {activities.map((activity) => (
                  <option key={activity.id} value={activity.id}>
                    {activity.name}
                  </option>
                ))}
                <p>Nombre: {activity.name}</p>
              </select>
              
            </div>
            {selectedActivity && (
              <div>
                <h2>Resumen de la actividad seleccionada:</h2>
                <p>Nombre: {selectedActivity.name}</p>
                <p>Dificultad: {selectedActivity.difficult}</p>
                <p>DuraciÃ³n: {selectedActivity.duration}</p>
                <p>Temporada: {selectedActivity.season}</p>
              </div>
            )}
          </div>

        </div>
      </div>

      <Footer />
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    countries: state.countries,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    getCountries: () => dispatch(getCountries()),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Detail);
